import React from 'react';

const SearchBox = ({searchfield, searchChange}) => {
	return(
	<div className='pa2 '>
		<input 
		className='pa3 ba bg bg-dark-blue white br2 b--dark-blue' 
		type='search' 
		placeholder='search robots'
		onChange ={searchChange} 
		/>
	</div>
		);
}

export default SearchBox;
